import React from 'react';
import Box from '@mui/material/Box';
import { TextField, Tabs, Tab } from '@mui/material';
import Typography from "@mui/material/Typography";
import { TabPanel } from '@mui/lab';
import More from "./More";

export default function ExploreSearch() {
    function TabPanel(props) {
        const { children, value, index, ...other } = props;
      
        return (
          <div
            role="tabpanel"
            hidden={value !== index}
            id={`vertical-tabpanel-${index}`}
            aria-labelledby={`vertical-tab-${index}`}
            {...other}
          >
            {value === index && (
              <Box sx={{ p: 3 }}>
                <Typography>{children}</Typography>
              </Box>
            )}
          </div>
        );
      }

    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
      setValue(newValue);
    };

    return (
        //BasicNavBar 위치 조정
        <Box sx={{ width: '95%', bgcolor: 'background.paper' }} textAlign='center' style={{ margin : 16, padding: 16, position:'relative'}}>
            <Tabs variant="fullWidth" value={value} onChange={handleChange}>
            {/* 각각의 Tab -> search, follower, following data  */}
            <Tab  label="검색">
            <TextField fullWidth  variant="standard" label="email ,ID 또는 할 일 검색" sx={{ boxShadow: 'none'}} /> 
            </Tab>
            <Tab  label="팔로워" />
            <Tab  label="팔로잉" />
            </Tabs>
            <TabPanel value={0} index={0}>
                <More/>
            </TabPanel>
            <TabPanel value={1} index={1}>Second content</TabPanel>
            <TabPanel value={2} index={2}>Third content</TabPanel>
        </Box>
    );
}
